import React from "react";

import "./index.css";

function VerticalHome(){
    return(
        <div className="verticalbackground">
            <div className="flexvertical">
                
                <div>
                  <text>Globe</text>
                </div>
                <div>
                    <text>Home</text>
                </div>

                </div>
        </div>
    )
}
export default VerticalHome;
